170822	Argumentasjon/kommunikasjon.|For hele skoleåret gjelder det at muntlig aktivitet som er faglig relevant, tillegges vekt i vurderingen. Likeså teller utførelse av lekser og arbeidsoppgaver som blir gitt i timene. Selv om lekser ikke er gitt, eller ved sykdom, forventes det at eleven er à jour med det stoffet som er gjennomgått i forutgående timer, samt utfører de oppgaver/lekser som er gitt i klassen. De som ikke er tilstede ved varslede prøver vil bli testet skriftlig eller muntlig ved første etterfølgende anledning, alternativt måtte ta prøven samtidig med første etterfølgende prøve.|Kap. 6.|	1	10241
